const ID = 'peace1';
const PI = 3.14159265359;
const startPosition = parcel.getFeatureById(ID).position;
const ySeed = Math.random(startPosition.y);
const zSeed = Math.random(startPosition.z);
let step = 0.0;

// Parcel Dimensions and Constraints
let width = 12.0;
let depth = 19.0;
let height = 15.0;
let maxDistX = width / 2;
let maxDistZ = depth / 2;

function fbm(t){
    let amplitude = 1.;
    let frequency = 1.;
    y = Math.sin(frequency);
    y += Math.sin(frequency*2.1 + t)*4.5;
    y += Math.sin(frequency*1.72 + t*1.121)*4.0;
    y += Math.sin(frequency*2.221 + t*0.437)*5.0;
    y += Math.sin(frequency*3.1122+ t*4.269)*2.5;
    y *= amplitude*0.06;
    return y;
}

setInterval(()=>{
    let cloud = parcel.getFeatureById(ID);
    let newX = startPosition.x + fbm(step + ySeed) / 10.;
    let newY = startPosition.y + fbm(step + zSeed) / 10.;
    let newZ = startPosition.z + fbm(step) / 10.;
    cloud.rotation.z = Math.sin(step * 5) * PI / 4.0;

    // Check if object is within bounds
    if (Math.abs(newX) < maxDistX)
        cloud.position.x = newX;
    if (Math.abs(newZ) < maxDistZ) 
        cloud.position.z = newZ;
    if (newY < 0) newY = 0;
    else if (newY > height + 1) newY = height;
    else cloud.position.y = newY;
    step+=0.01;
},50);

